import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import { Cell } from "./components";

class App extends Component {
  state = {
    board: [[], [], [], [], [], [], [], [], []]
  };

  componentWillMount() {
    this.populateBoard();
  }

  populateBoard() {
    for (let i = 0; i < 9; i++) {
      for (let j = 0; j < i; j++) {
        this.state.board[i].push(j + 1);
      }
    }
    console.log(this.state.board);
  }

  renderGameBoard() {
    for (let j = 0; j < 9; j++) {
      for (let i = 0; i < this.state.board[j].length; i++) {
        return (
          <div>
            {console.log("hello")}
            {this.state.board[i].map(cell => (
              <Cell key={cell} />
            ))}
            ;
          </div>
        );
      }
    }
  }

  render() {
    return <div className="cellView">{this.renderGameBoard()}</div>;
  }
}

export default App;
